void find_res(uint a, uint b) {
  uint res_max = 0;
  uint res = 0;

  for (uint i=a; i<=b; ++i) {
    uint k = gen_seq(i);
    if (k > res_max) {
      res_max = k;
      res = i;
    }
  }

  cout << "Between " << a << " and " << b << ", " << res << " generates the longest sequence of " << res_max << " values." << endl;
}

